import React from "react";
import { Toolbar, Button, Typography, Box } from "@mui/material";

const RenderTabs = ({ onFilter, onListView, onGraphMode }) => {
  return (
    <Toolbar sx={{ width: "100%", justifyContent: "space-between" }}>
      <Typography variant="h6" component="div">
        RenderTab
      </Typography>
      <Box>
        <Button onClick={onFilter} color="inherit">
          Filter
        </Button>
        <Button onClick={onListView} color="inherit">
          ListView
        </Button>
        <Button onClick={onGraphMode} color="inherit">
          GraphMode
        </Button>
      </Box>
    </Toolbar>
  );
};

export default RenderTabs;
